import React from 'react';
import { connect } from 'react-redux';

const ExampleComponent = ({ data, dispatchExampleAction }) => {
  return (
    <div>
      <p>{data}</p>
      <button onClick={() => dispatchExampleAction('New Data')}>
        Update Data
      </button>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    data: state.example.data,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    dispatchExampleAction: (newData) =>
      dispatch({
        type: 'EXAMPLE_ACTION',
        payload: Promise.resolve(newData), // or use other techniques for async operations
      }),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(ExampleComponent);
